import React from "react";

import MenuItem from "../menu-item/menu-item";

import "./directory.scss";

const Directory = () => (
  <div className="directory-menu">
    {this.state.sections.map(({ title, imageUrl, id, size, linkUrl }) => (
      <MenuItem
        key={id}
        title={title}
        imageUrl={imageUrl}
        size={size}
        linkUrl={linkUrl}
      />
    ))}
  </div>
);

export default Directory;
